import Nav from "./components/Navbar/Navbar";
import Dialogs from "./components/Dialogs/Dialogs"

function App() {
    return (
        <div className="app-wrapper">

            <Header/>

            <Nav/>
            <div>
                <Dialogs/>
            </div>
            {/*<Profile/>*/}



        </div>
    );
}

export default App;
